import React, {Component} from 'react';
import $ from 'jquery';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import './login.css';


class Login extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
  }

  componentDidUpdate() {
  }


  render() {
    return (
      <div class="login-container">
        <div class="tabs-container">
          <Tabs>
            <TabList>
              <Tab>Login</Tab>
              <Tab>Register</Tab>
            </TabList>

            <TabPanel>
              <h5>Login</h5>
            </TabPanel>
            <TabPanel>
              <h5>Register</h5>
            </TabPanel>
          </Tabs>
        </div>
      </div>
    );
  }
}
export default Login;
